    "2013-03-19T00:27:33.779868",nt"name": "chert-geochemistry-discriminant-analysis-and-k-meas-cluster-analysis-rampart-project-area-tanan",nt"isopen":
    false,nt"url": null,nt"notes": "A pilot study using discriminant analysis
    on major oxide and minor element data from 67 chert samples in the Rampart area,
    southeastern Tanana and southwest Livengood Quadrangles, western Yukon-Tanana Upland,
    Alaska, generally indicates a unique geochemical signature for the cherts of a given
    unit.Chert samples from five known type locales were used as standards of comparison:
    1)Livengood Dome Chert (Ordovician), 2)Amy Creek unit (Proterozoic to early Paleozoic),
    3)Rampart Group (Mississippian to Triassic), 4)Troublesome Creek unit (Devonian),
    and 5)Permian-Triassic clastic unit (associated with the Triassic-dated gabbro).
    Samples from the above units were compared to chert from Tanana B-1 area-units of
    unknown or uncertain affinity.We have determined that discriminant analysis of chert
    geochemistry can assign chert profiles to specific units with only minor exceptions,
    and is useful in geologic mapping of the Tanana B-1 Quadrangle (Reifenstuhl and
    others, 1997).",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
